import React from 'react'

export default function CheckAll(props) {
    
    function resultsDisplay() {
        if (props.correctNumber.check) {
            return <h5>You got {props.correctNumber.currentCorrect}/5 correct</h5>
        }
    }
    
  return (
    <div>
        <button onClick={props.CheckAll}>
            {props.correctCounter.check ? "Try New questions" : "Check Result"} 
        </button>

    </div>
  )
}
